public class PrintMultiplicationTable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
          int num = 7;
          for(int i=1;i<=10;i++) {
        	  System.out.println(num+" * "+i+" = "+num*i);
          }
	}

}
